INSERT INTO `usb-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/USB-Stick/SanDisk Ultra Fit .webp;', 'SanDisk Ultra Fit ', 'https://www.amazon.de/SanDisk-Ultra-FlashLaufwerk-130MB-Lesen/dp/B07857Y17V/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=RCHFRZX0GYNP&keywords=SanDisk+Ultra+Fit&qid=1667662476&sprefix=kexin+usb+32gb+dual+otg+memory+stick%2Caps%2C115&sr=8-3', '26,90', 4.7, 110071, 2, 'black;SanDisk;12.8 g;USB;SanDisk;130 Megabytes Per Second;Ultra Fit;256 GB;Profitieren Sie von der SanDisk SecureAccess- und der RescuePRO Deluxe Software, die Ihre privaten Daten sichert und problemlos wiederherstellt|Übertragen Sie mit dem USB Stick ganze Spielfilme in weniger als 30 Sekunden|Ihr USB Laufwerk bietet Ihnen schnelle Datenübertragung mit Lesegeschwindigkeiten von bis zu 130 MB/s|Der SanDisk USB ist ideal geeignet für Ihren Laptop oder Desktop-PC sowie für Ihre Spielekonsolen und Audiosysteme in Autos|Lieferumfang: SanDisk Ultra Fit USB 3.1 Flash-Laufwerk 256 GB (Für Laptops, Spielkonsolen und Auto-Audiosysteme, Plug-and-Stay, 130 MB/s Lesen, SecureAcess Software) 5 Jahre Garantie|Fehlerbehebungsschritt: Wir empfehlen, das Gerät an einen anderen Computer anzuschließen, um zu überprüfen, ob das Problem beim Gerät oder beim Host (Computer) liegt');
INSERT INTO `usb-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/USB-Stick/Sandisk Ultra Flair.webp;', 'Sandisk Ultra Flair', 'https://www.amazon.de/SanDisk-Ultra-Flair-USB-Flash-Laufwerk-150-MB/dp/B015CH1NAQ/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1KIXJDXI7U0ZX&keywords=Sandisk+Ultra+Flair&qid=1667662484&sprefix=sandi%2Caps%2C126&sr=8-3', '7,90', 4.6, 111172, 0, 'black;SanDisk;4.5 g;USB 3.0;SanDisk;150 Megabytes Per Second;SDCZ73-064G-G46;64 GB;Dank der RescuePRO Software werden verloren gegangene oder beschädigte Dateien einfach wiederhergestellt; Im Lieferumfang enthalten ist ein 1-jähriges Abonnement der Wiederherstellungssoftware|Die ultraschnelle USB 3.0-Leistung von bis zu 150 MB/s ermöglicht Ihnen eine noch schnellere Übertragung Ihrer Dateien|Übertragen Sie Spielfilme in weniger als 30 Sekunden auf den USB Stick; Der USB ist nicht nur robust und stoßfest, sondern sieht durch das schlanke Design auch schick aus|Das USB Flash-Laufwerk verfügt über einen Passwortschutz, damit Ihre privaten Dateien auch privat bleiben; Sichern Sie Ihre Dateien mit Stil|Lieferumfang: SanDisk Ultra Flair USB 3.0 Flash-Laufwerk 64 GB (robustes und elegantes Metallgehäuse, Passwortschutz, 150 MB/s Lesen) Schwarz');
INSERT INTO `usb-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/USB-Stick/Viekuu USB-Stick.webp;', 'Viekuu USB-Stick', 'https://www.amazon.de/VIEKUU-Speicherstick-Geschwindigkeit-s-Drehbarer-Metallspeicherstick-3-0-3-PC-Schwarz/dp/B09MH4Z8NL/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1ODPZLGIX7C2E&keywords=Viekuu+USB-Stick&qid=1667662490&sprefix=%2Caps%2C83&sr=8-3', '20,99', 4.3, 240, 3, 'black;VIEKUU;-;-;-;USB, USB 3.0, USB 2.0;-;120 Megabytes Per Second;-;8 GB;Die Lesegeschwindigkeit jedes VIEKUU 3PC 3.0 8 GB, 3.0 USB-Flash-Laufwerks ist mehr als zehnmal so hoch wie die von 2.0. Dies kann zu einer höheren Effizienz führen und wurde speziell für Geschäftsleute entwickelt. Erinnerung: Es kann auf der Schnittstelle 2.0 verwendet werden, auf der Schnittstelle 3.0 ist die Geschwindigkeit jedoch höher.|Einfach zu bedienen - alle Speicherlaufwerke werden vor der Auslieferung getestet, Plug-and-Play, keine Installation von Software, schnelle Datenübertragung.|360 ° -Drehung und Schlüsselbunddesign schützen die USB-Schnittstelle besser und sind leicht zu tragen.|Kompatibles System - Das Flash-Laufwerk ist mit den meisten Computermarken wie HP, Toshiba, Dell kompatibel. Die Systeme sind Windows 7/8/10 / Vista / XP / 2000 / ME / NT, Linux 2.6 und Mac OS 8.6 oder höher.|Breites Anwendungsspektrum: Die U-Disk kann mit Desktops, Laptops, Lautsprechern, Fernsehgeräten, Druckern, Auto-Videosystemen und Smart-TVs mit USB-Anschlüssen verwendet werden und ermöglicht die Übertragung von Daten. VIEKUU-Flash-Laufwerke sind standardmäßig im exFAT-Format formatiert. Wenn Ihr Gerätesystem ein USB-Laufwerk verwendet, formatieren Sie das USB-Laufwerk im NTFS-Format wie Windows XP oder MAC.');
INSERT INTO `usb-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/USB-Stick/Topesel USB Stick 128GB.webp;', 'Topesel USB Stick 128GB', 'https://www.amazon.de/TOPESEL-USB-Stick-USB-Flash-Laufwerk-Speicherstick-Lesngeschwindichkeit/dp/B08LG94ZR8/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2V0HDLJD4J0IY&keywords=Topesel+USB+Stick+128GB&qid=1667662495&sprefix=%2Caps%2C78&sr=8-4', '24,99', 4.5, 6751, 0, 'red;TOPESEL;-;-;-;USB, USB 3.0;-;350 Megabytes Per Second;-;128 GB;【High Speed】:USB 3.1 Gen 2 .Lesegeschwindigkeit bis zu 350 MB/s. Schreibgeschwindigkeit bis zu 200 MB/s.Sparen Sie Zeit und steigern Sie die Effizienz erheblich.|【Tragbar und Praktisch】:128 GB große Speicherkapazitäten und das Design des hinteren Seillochs verhindert Verluste. Das tragbare Design erfüllt alle Ihre Anforderungen bei der Arbeit, in der Schule, zu Hause und auf Reisen für Fotos, Musik, Videos, Dateispeicherung und -übertragung.|【Plug und Play】:Sie müssen keine zusätzliche Software installieren. Der USB-Speicherstick kann sofort erkannt und genutzt werden. Mit hoher Lese- und Schreibgeschwindigkeit, Sie können Zeit sparen und die Effizienz verbessern.|【Breiter Kompatibilität】 :Unterstützt Windows ME / NT / 2000 / XP/7/8/10, Vista, XP Linux, Mac OS 10.3 und höher. Abwärtskompatibel mit USB 3.0, 2.0 &amp; 1.1|【Was Sie bekommen】：Eine 128GB USB-Speischerstick in Rot und Lebenslange Garantie.Wir werden Sie innerhalb 24 Stunde antworten,wenn Sie irgendwas Fragen haben.');
INSERT INTO `usb-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/USB-Stick/SanDisk Extreme  PRO.webp;', 'SanDisk Extreme  PRO', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo3MTQzMTE4NjczMjI5NTQxOjE2Njc2NjI1MDk6c3BfYXRmOjIwMDQyODY0NzYzMDAzOjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FSanDisk-Extreme-128GB-Memory-170MB%2Fdp%2FB07H9DVLBB%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D11C0KOPVGLAWX%26keywords%3DSanDisk%2BExtreme%2BPRO%26qid%3D1667662509%26sprefix%3Ds%252Caps%252C97%26sr%3D8-1-spons%26psc%3D1', '29,99', 4.8, 166588, 1, '-;SanDisk;17.8 g;-;SanDisk;-;-;128 GB;Professionelle Leistung für schnelle Aufnahmen und 4K UHD Videos mit der SanDisk Speicherkarte; Im Lieferumfang inbegriffen ist die 2-jährige Nutzung der Software RescuePRO Deluxe zur Wiederherstellung von versehentlich gelöschten Bildern|Dank der schnellen Übertragung von bis zu 170 MB/s warten Sie nicht mehr lange, während Ihre Bilder und Videos auf Ihre SD Karte oder von Ihrer SD Karte auf den Computer übertragen werden|Machen Sie verlustfreie Videoaufzeichnungen dank UHS Speed Klasse 3 (U3) und Video Speed Klasse 30 (V30) mit der SD Karte für Kamera|Die SDXC Speicherkarte ist für extreme Bedingungen ausgelegt und ist dazu temperaturbeständig, wasserdicht, stoßfest und röntgensicher|Lieferumfang: SanDisk Extreme PRO SDXC UHS-I Speicherkarte 128 GB (V30, Übertragungsgeschwindigkeit 170 MB/s, U3, 4K UHD Videos, temperaturbeständig)');
